css:
@charset "utf-8";
@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document url("about:blank") {
  * {
    padding: 0px;
    margin: 0px;
    height: 100%;
    width: 100%;
    overflow: hidden;
  }


  body {
    background-color: #808080;
    background-repeat: no-repeat;
    background-position: 50% 30%;
    background-image: url(data:image/gif;base64,);
  }
}
